DROP TABLE IF EXISTS `sensors_view`;
CREATE TABLE `sensors_view` (
  `sensor_id` int(10) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '传感器 ID',
  `sensor_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '传感器名称',
  `sensor_type` enum('力传感器','气密传感器','热传感器','光传感器','位置传感器','电磁传感器','扭矩传感器','其它传感器') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '其它传感器' COMMENT '传感器类型',
  `company_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '出品公司名称',
  `sensor_feature` set('耐高温','耐低温','耐油','高防水等级','高精度','低功耗','广测量范围','低噪声','微型','抗冲击','长寿命') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '传感器特征',
  `output_type` tinyint(4) NOT NULL DEFAULT '2' COMMENT '输出类型（1 数字信号 0 模拟信号 2 都可以）',
  `output_max` int(11) NOT NULL DEFAULT '0' COMMENT '最高电压输出(v)',
  `output_min` int(11) NOT NULL DEFAULT '0' COMMENT '最低电压输出(v)',
  `temp_max` int(11) NOT NULL DEFAULT '0' COMMENT '最高工作温度(摄氏度)',
  `temp_min` int(11) NOT NULL DEFAULT '0' COMMENT '最低工作温度(摄氏度)',
  `username` char(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'adminFang' COMMENT '添加用户',
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`sensor_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=535 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC;

